  "3P": 2.1,
  "3PA": 5.8,
  "3P%": 0.355,
  "2P": 7.7,
  "2PA": 13.3,
  "2P%": 0.582,
  "eFG%": 0.567,
  "FT": 5.1,
  "FTA": 7.4,
  "FT%": 0.679,
  "ORB": 0.9,
  "DRB": 7.7,
  "TRB": 8.6,
  "AST": 7.6,
  "STL": 1.3,
  "BLK": 0.6,
  "TOV": 3.5,
  "PF": 1.7,
  "PS/G": 26.8
}

function PlayerInfoPage(props) {
  return (
    <Grid container direction="column">
      <Avatar src={players[0].img} style={styles.avatar} />
      <Typography variant="h1" style={styles.title}>{players[0].name}</Typography>
      <List>
        {statistics = function () {
          let s = []
          for (key in stats) {
            s.push(
              <ListItem >
                <ListItemAvatar>
                  <Avatar style={styles.wordAvatar}>{key}</Avatar>
                </ListItemAvatar>
                <Typography variant="h3" style={styles.title}>{stats[key]}</Typography>
              </ListItem>
            );
          }
        }}
        {/* <ListItem >
          <ListItemAvatar>
            <Avatar style={styles.wordAvatar}>Pos</Avatar>
          </ListItemAvatar>
          <Typography variant="h3" style={styles.title}>SF</Typography>
        </ListItem> */}
      </List>
    </Grid>
  );
}

